import React from "react";
import { Box, Link } from "@chakra-ui/core";

interface NavBarProps {}

const NavBar: React.FC<NavBarProps> = ({}) => {
  return (
    <Box bg="tomato" p={4} ml={"auto"}>
      <Box>
        <Link>Login</Link>
        <Link>Register</Link>
      </Box>
    </Box>
  );
};

export default NavBar;
